import {AppBar,Toolbar,styled,Box} from '@mui/material'
import LoginDialogue from "./Account/Login Dialogue";

const Header=styled(AppBar)`
Height:220px;
background-color:#00bfa5;
box-shadow:none;
`
const Messenger=()=>{


    return(
        <Box>
            <Header>
                <Toolbar>

                </Toolbar>
            </Header>
        <LoginDialogue/>
        </Box>
    )
}
export default Messenger;
